import React from "react";

const Header = (props) => (
  <header>
    <h1>This is my app header</h1>
    <nav>
      <a className={`nav-link${props.path === "/" ? "active" : null}`} href="/">
        Home
      </a>
      <a
        className={`nav-link${props.path === "/other" ? "active" : null}`}
        href="/other"
      >
        Other Page
      </a>
    </nav>
  </header>
);

export default Header;
